    const name=this.props.name;
    const url=this.props.avatar_url;

    return(
        <div className="col-md-3">
            <div className="card">
            <div class="card-header">
    <h1>{name}</h1>
    <h1>{url}</h1>
  </div>
  
            </div>
        </div>)
    }

}



export default OrganisationCard;
